UPDATE tc_direct_project set create_date = TO_DATE('2015-01-01 00:12:00', '%Y-%m-%d %H:%M:%S') - (project_id - 30000000)*23 units hour where project_id > 30000000 and project_id < 30001000;
UPDATE tc_direct_project set modify_date = TO_DATE('2015-01-01 00:18:00', '%Y-%m-%d %H:%M:%S') - ((project_id - 30000000) * 17) units hour where project_id > 30000000 and project_id < 30001000;
update tc_direct_project set project_status_id = (MOD(project_id, 5) + 1);
