INSERT INTO user_terms_of_use_xref     SELECT u.user_id, t.terms_of_use_id, CURRENT, CURRENT     FROM user u JOIN terms_of_use t ON 1=1     LEFT JOIN (SELECT user_id, terms_of_use_id FROM user_terms_of_use_xref) x          ON x.user_id = u.user_id AND x.terms_of_use_id = t.terms_of_use_id    WHERE x.user_id IS NULL;
INSERT INTO user_rating   SELECT u.user_id,          ABS(MOD(TRUNC((((u.user_id * 1103515245) + 12345) - 4294967296 * TRUNC(((t.project_category_id * 1103515245) + 12345) / 4294967296)) / 65536), 3000)),          t.project_category_id + 111, 0, 0, 0, CURRENT, CURRENT,   NULL::DECIMAL(12,0)   FROM user u JOIN project_category_lu t ON 1=1   LEFT JOIN (SELECT user_id, phase_id FROM user_rating) x        ON x.user_id = u.user_id AND x.phase_id = (t.project_category_id + 111)  WHERE x.user_id IS NULL AND t.project_category_id IN (1, 2, 6, 7, 13, 14, 19, 23, 24, 26, 35, 36);
